import React, { Component } from "react";
import Form from "react-validation/build/form";
import Input from "react-validation/build/input";
import CheckButton from "react-validation/build/button";
// import AuthService from "../services/auth.service";
// import { PostData } from "./PostData";
import { Redirect, Switch } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer'



const required = value => {
    if (!value) {
        return (
            <div className="alert alert-danger" role="alert">
                This field is required!
            </div>
        );
    }
};

export default class RegisterProject extends Component {

    constructor(props) {
        super(props);
        this.handleLogin = this.handleLogin.bind(this);
        this.onChangeUsername = this.onChangeUsername.bind(this);
        this.onChangePassword = this.onChangePassword.bind(this);

        this.state = {
          username: "",
          password: "",
          loading: false,
          message: ""
        };
      }


      onChangeUsername(e) {
        this.setState({
          username: e.target.value
        });
      }

      onChangePassword(e) {
        this.setState({
          password: e.target.value
        });
      }

      handleLogin(e) {
        e.preventDefault();

        this.setState({
          message: "",
          loading: true
        });

        this.form.validateAll();




    }


    render() {



        const {loading} = this.state;

        // if (this.state.redirectToReferrer) {
        //     return (<Redirect to={'/dashboard'} />)
        // }

        // if (sessionStorage.getItem('token')) {
        //     return (<Redirect to={'/dashboard'} />)
        // }



        return (


            <div>
                        <Header />
                        <Footer/>



  {/*begin::Main*/}
  {/*begin::Header Mobile*/}
  <div id="kt_header_mobile" className="header-mobile bg-primary header-mobile-fixed">
    {/*begin::Logo*/}
    <a href="index.html">
      <img alt="Logo" src="assets/media/logos/logo-letter-9.png" className="max-h-30px" />
    </a>
    {/*end::Logo*/}
    {/*begin::Toolbar*/}
    <div className="d-flex align-items-center">
      <button className="btn p-0 burger-icon burger-icon-left ml-4" id="kt_header_mobile_toggle">
        <span />
      </button>
      <button className="btn p-0 ml-2" id="kt_header_mobile_topbar_toggle">
        <span className="svg-icon svg-icon-xl">
          {/*begin::Svg Icon | path:assets/media/svg/icons/General/User.svg*/}
          <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
            <g stroke="none" strokeWidth={1} fill="none" fillRule="evenodd">
              <polygon points="0 0 24 0 24 24 0 24" />
              <path d="M12,11 C9.790861,11 8,9.209139 8,7 C8,4.790861 9.790861,3 12,3 C14.209139,3 16,4.790861 16,7 C16,9.209139 14.209139,11 12,11 Z" fill="#000000" fillRule="nonzero" opacity="0.3" />
              <path d="M3.00065168,20.1992055 C3.38825852,15.4265159 7.26191235,13 11.9833413,13 C16.7712164,13 20.7048837,15.2931929 20.9979143,20.2 C21.0095879,20.3954741 20.9979143,21 20.2466999,21 C16.541124,21 11.0347247,21 3.72750223,21 C3.47671215,21 2.97953825,20.45918 3.00065168,20.1992055 Z" fill="#000000" fillRule="nonzero" />
            </g>
          </svg>
          {/*end::Svg Icon*/}
        </span>
      </button>
    </div>
    {/*end::Toolbar*/}
  </div>
  {/*end::Header Mobile*/}
  <div className="d-flex flex-column flex-root">
    {/*begin::Page*/}
    <div className="d-flex flex-row flex-column-fluid page">
      {/*begin::Wrapper*/}
      <div className="d-flex flex-column flex-row-fluid wrapper" id="kt_wrapper">

        {/*begin::Content*/}
        <div className="content d-flex flex-column flex-column-fluid" id="kt_content">
          {/*begin::Subheader*/}
          <div className="subheader py-2 py-lg-6 subheader-transparent" id="kt_subheader">
            <div className="container d-flex align-items-center justify-content-between flex-wrap flex-sm-nowrap">
              {/*begin::Info*/}
              <div className="d-flex align-items-center flex-wrap mr-1">
                {/*begin::Page Heading*/}
                <div className="d-flex align-items-baseline flex-wrap mr-5">
                  {/*begin::Page Title*/}
                  {/*end::Page Title*/}
                  {/*begin::Breadcrumb*/}
                  <ul className="breadcrumb breadcrumb-transparent breadcrumb-dot font-weight-bold p-0 my-2 font-size-sm">
                    <li className="breadcrumb-item">
                    </li>
                    <li className="breadcrumb-item">
                    </li>
                  </ul>
                  {/*end::Breadcrumb*/}
                </div>
                {/*end::Page Heading*/}
              </div>
              {/*end::Info*/}
              {/*begin::Toolbar*/}
              <div className="d-flex align-items-center">
                {/*begin::Actions*/}
                {/*end::Actions*/}
                {/*begin::Dropdown*/}
                <div className="dropdown dropdown-inline" data-toggle="tooltip" title="Quick actions" data-placement="left">
                  <a href="#" className="btn btn-icon" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    <span className="svg-icon svg-icon-success svg-icon-2x">
                      {/*begin::Svg Icon | path:assets/media/svg/icons/Files/File-plus.svg*/}

                      {/*end::Svg Icon*/}
                    </span>
                  </a>
                  <div className="dropdown-menu dropdown-menu-md dropdown-menu-right p-0 m-0">
                    {/*begin::Navigation*/}
                    <ul className="navi navi-hover">
                      <li className="navi-header font-weight-bold py-4">
                        <span className="font-size-lg">Choose Label:</span>
                        <i className="flaticon2-information icon-md text-muted" data-toggle="tooltip" data-placement="right" title="Click to learn more..." />
                      </li>
                      <li className="navi-separator mb-3 opacity-70" />
                      <li className="navi-item">
                        <a href="#" className="navi-link">
                          <span className="navi-text">
                            <span className="label label-xl label-inline label-light-success">Customer</span>
                          </span>
                        </a>
                      </li>
                      <li className="navi-item">
                        <a href="#" className="navi-link">
                          <span className="navi-text">
                            <span className="label label-xl label-inline label-light-danger">Partner</span>
                          </span>
                        </a>
                      </li>
                      <li className="navi-item">
                        <a href="#" className="navi-link">
                          <span className="navi-text">
                            <span className="label label-xl label-inline label-light-warning">Suplier</span>
                          </span>
                        </a>
                      </li>
                      <li className="navi-item">
                        <a href="#" className="navi-link">
                          <span className="navi-text">
                            <span className="label label-xl label-inline label-light-primary">Member</span>
                          </span>
                        </a>
                      </li>
                      <li className="navi-item">
                        <a href="#" className="navi-link">
                          <span className="navi-text">
                            <span className="label label-xl label-inline label-light-dark">Staff</span>
                          </span>
                        </a>
                      </li>
                      <li className="navi-separator mt-3 opacity-70" />
                      <li className="navi-footer py-4">
                        <a className="btn btn-clean font-weight-bold btn-sm" href="#">
                          <i className="ki ki-plus icon-sm" />Add new</a>
                      </li>
                    </ul>
                    {/*end::Navigation*/}
                  </div>
                </div>
                {/*end::Dropdown*/}
              </div>
              {/*end::Toolbar*/}
            </div>
          </div>
          {/*end::Subheader*/}
          {/*begin::Entry*/}
          <div className="d-flex flex-column-fluid">
            {/*begin::Container*/}
            <div className="container">
              <div className="card card-custom">
                <div className="card-body p-0">
                  {/*begin: Wizard*/}
                  <div className="wizard wizard-2" id="kt_wizard" data-wizard-state="step-first" data-wizard-clickable="false">
                    {/*begin: Wizard Nav*/}
                    <div className="wizard-nav border-right py-8 px-8 py-lg-20 px-lg-10">
                      {/*begin::Wizard Step 1 Nav*/}
                      <div className="wizard-steps">
                        <div className="wizard-step" data-wizard-type="step" data-wizard-state="current">
                          <div className="wizard-wrapper">
                            <div className="wizard-icon">
                              <span className="svg-icon svg-icon-2x">
                                {/*begin::Svg Icon | path:assets/media/svg/icons/General/User.svg*/}
                                <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
                                  <g stroke="none" strokeWidth={1} fill="none" fillRule="evenodd">
                                    <polygon points="0 0 24 0 24 24 0 24" />
                                    <path d="M12,11 C9.790861,11 8,9.209139 8,7 C8,4.790861 9.790861,3 12,3 C14.209139,3 16,4.790861 16,7 C16,9.209139 14.209139,11 12,11 Z" fill="#000000" fillRule="nonzero" opacity="0.3" />
                                    <path d="M3.00065168,20.1992055 C3.38825852,15.4265159 7.26191235,13 11.9833413,13 C16.7712164,13 20.7048837,15.2931929 20.9979143,20.2 C21.0095879,20.3954741 20.9979143,21 20.2466999,21 C16.541124,21 11.0347247,21 3.72750223,21 C3.47671215,21 2.97953825,20.45918 3.00065168,20.1992055 Z" fill="#000000" fillRule="nonzero" />
                                  </g>
                                </svg>
                                {/*end::Svg Icon*/}
                              </span>
                            </div>
                            <div className="wizard-label">
                              <h3 className="wizard-title">Project Details</h3>
                              <div className="wizard-desc">Setup Your Project Details</div>
                            </div>
                          </div>
                        </div>
                        {/*end::Wizard Step 1 Nav*/}
                        {/*begin::Wizard Step 4 Nav*/}
                        <div className="wizard-step" data-wizard-type="step">
                          <div className="wizard-wrapper">
                            <div className="wizard-icon">
                              <span className="svg-icon svg-icon-2x">
                                {/*begin::Svg Icon | path:assets/media/svg/icons/Map/Position.svg*/}
                                <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
                                  <g stroke="none" strokeWidth={1} fill="none" fillRule="evenodd">
                                    <rect x={0} y={0} width={24} height={24} />
                                    <path d="M19,11 L21,11 C21.5522847,11 22,11.4477153 22,12 C22,12.5522847 21.5522847,13 21,13 L19,13 C18.4477153,13 18,12.5522847 18,12 C18,11.4477153 18.4477153,11 19,11 Z M3,11 L5,11 C5.55228475,11 6,11.4477153 6,12 C6,12.5522847 5.55228475,13 5,13 L3,13 C2.44771525,13 2,12.5522847 2,12 C2,11.4477153 2.44771525,11 3,11 Z M12,2 C12.5522847,2 13,2.44771525 13,3 L13,5 C13,5.55228475 12.5522847,6 12,6 C11.4477153,6 11,5.55228475 11,5 L11,3 C11,2.44771525 11.4477153,2 12,2 Z M12,18 C12.5522847,18 13,18.4477153 13,19 L13,21 C13,21.5522847 12.5522847,22 12,22 C11.4477153,22 11,21.5522847 11,21 L11,19 C11,18.4477153 11.4477153,18 12,18 Z" fill="#000000" fillRule="nonzero" opacity="0.3" />
                                    <circle fill="#000000" opacity="0.3" cx={12} cy={12} r={2} />
                                    <path d="M12,17 C14.7614237,17 17,14.7614237 17,12 C17,9.23857625 14.7614237,7 12,7 C9.23857625,7 7,9.23857625 7,12 C7,14.7614237 9.23857625,17 12,17 Z M12,19 C8.13400675,19 5,15.8659932 5,12 C5,8.13400675 8.13400675,5 12,5 C15.8659932,5 19,8.13400675 19,12 C19,15.8659932 15.8659932,19 12,19 Z" fill="#000000" fillRule="nonzero" />
                                  </g>
                                </svg>
                                {/*end::Svg Icon*/}
                              </span>
                            </div>
                            <div className="wizard-label">
                              <h3 className="wizard-title">Add Project Address</h3>
                              <div className="wizard-desc">Address, Street, City, State</div>
                            </div>
                          </div>
                        </div>
                        {/*end::Wizard Step 4 Nav*/}

                        {/*begin::Wizard Step 3 Nav*/}
                        <div className="wizard-step" data-wizard-type="step">
                          <div className="wizard-wrapper">
                            <div className="wizard-icon">
                              <span className="svg-icon svg-icon-2x">
                                {/*begin::Svg Icon | path:assets/media/svg/icons/General/Thunder-move.svg*/}
                                <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
